"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[163],{4608:e=>{e.exports=JSON.parse('{"label":"webframework","permalink":"/docs/tags/webframework","allTagsPath":"/docs/tags","count":1,"items":[{"id":"Laravel/what_is_webframework","title":"What is Web Framework","description":"Web development often involves writing repetitive code for common tasks. For instance, when creating a new table for a website, multiple tasks need to be accomplished: writing SQL for table creation, crafting templates for adding, viewing, listing, and updating items, and developing PHP scripts for input validation and output sanitization. These tasks can be time-consuming and repetitive, especially when repeated for each new table or feature in a project. Is there a more efficient way? That\'s where web frameworks come in.","permalink":"/docs/Laravel/what_is_webframework"}]}')}}]);